import React from 'react';
import PropTypes from 'prop-types';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import Paper from '@material-ui/core/Paper';
import Box from '@material-ui/core/Box';

import NewListTricep from './NewListTricep';
import NewListChest from './NewListChest';
import NewListBicep from './NewListBicep';
import NewListBack from './NewListBack';

import { withStyles } from "@material-ui/core/styles";

const styles = theme => ({
  tabRoot: {
    color: "#bdc0c4",
    "&:hover": {
      color: "#ffffff",
      opacity: 1
    },
    "&$selected": {
      color: "red",
      fontWeight: theme.typography.fontWeightMedium
    },
    textTransform: "initial"
  },
  selected: {}
});

const StyledTab = withStyles(styles)(Tab)

function TabPanel(props) {
    const { children, value, index, ...other } = props;

    return (
      <div
        role="tabpanel"
        hidden={value !== index}
        id={`simple-tabpanel-${index}`}
        aria-labelledby={`simple-tab-${index}`}
        {...other}
      >
        {value === index && (
          <Box p={3}>
            <Typography>{children}</Typography>
          </Box>
        )}
      </div>
    );
  };

  TabPanel.propTypes = {
    children: PropTypes.node,
    index: PropTypes.any.isRequired,
    value: PropTypes.any.isRequired,
  };

  function a11yProps(index) {
    return {
      id: `simple-tab-${index}`,
      'aria-controls': `simple-tabpanel-${index}`,
    };
  };

const TabsZelf = () => {
    const [value, setValue] = React.useState(0);

    const handleChange = (event, newValue) => {
      setValue(newValue);
    };


    return(
        <div>
            <Paper square className="paper" style={{boxShadow: 'none'}}>
                <Tabs
                  value={value}
                  indicatorColor="secondary"
                  textColor="primary"
                  onChange={handleChange}
                  aria-label="disabled tabs example"
                  className="tabs"
                  style={{marginTop: '70px'}}
                >

                  <StyledTab label="Tab 1" />
                  <StyledTab label="Tab 2" />
                  <StyledTab label="Tab 3" />
                </Tabs>
                <TabPanel value={value} index={0} className="tabpanel">
                  <NewListChest/>
                </TabPanel>
                <TabPanel value={value} index={1} className="tabpanel">
                  <NewListBicep />
                </TabPanel>
                <TabPanel value={value} index={2} className="tabpanel">
                  <NewListTricep/>
                </TabPanel>
                <TabPanel value={value} index={3} className="tabpanel">
                  <NewListBack />
                </TabPanel>
              </Paper>

        </div>

    )
}

export default TabsZelf;
